import Kinder from './Kinder'
import Title from './Title'

export default function Products(props) {

  return (
   
    <div className='productBox'>
      <Title text={"Kinder products"} />
      {props.kinders.map((kinder) => {
        return <Kinder kinder={kinder}  addToCart={props.addToCart}/>
      })}      
              {/* <button onClick={() => props.removeFromCart(props.kinder)}>-</button> */}

    </div>
  )
}
